import db from "../Database"; 
import { Link } from "react-router-dom";




function Search() {
    const breeds = db.breeds;
    return(
        <div>

            <h1>This is the search results for you</h1> 
            <div className="list-group"> 
                {breeds.map((breed) => ( 
                <Link key={breed.id} to={`/detail`} className="list-group-item"> 
                {breed.id}<br/>
                {breed.name} 
                </Link> ))} 
            </div>
        </div>

    );
 };
 export default Search;
